export const ToothPick = () => {
    const [chosenTooth, setChosenTooth] = useState(0);
    return (
        <div className="toothpicker">
            <input type="hidden" name="teethId" value={chosenTooth} />
            <div className="toothpicker__box">{topTeeth.map(tooth => {
                return tooth.props.id === chosenTooth 
                ? <div className="toothpicker__active" key={tooth.props.id} onClick={() => setChosenTooth(p => p = tooth.props.id)}>{tooth}{tooth.props.id}</div> 
                : <div key={tooth.props.id} onClick={() => setChosenTooth(p => p = tooth.props.id)}>{tooth}{tooth.props.id}</div>
            })}</div>
            
            <div className="toothpicker__box toothpicker__box-bottom">{bottomTeeth.map(tooth => {
                return tooth.props.id === chosenTooth 
                ? <div className="toothpicker__active" key={tooth.props.id} onClick={() => setChosenTooth(p => p = tooth.props.id)} >{tooth.props.id}{tooth}</div> 
                : <div key={tooth.props.id} onClick={() => setChosenTooth(p => p = tooth.props.id)} >{tooth.props.id}{tooth}</div> 
            })}</div>

        </div>
    );
}


